  \"aqua-airs-near-real-time-nrt-level-2-standard-physical-retrieval-airsamsu-v006\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Atmospheric Infrared Sounder (AIRS)
  is a facility instrument aboard the second Earth Observing System (EOS) polar-orbiting
  \ platform, EOS Aqua. In combination with the Advanced Microwave  Sounding Unit
  (AMSU) and the Humidity Sounder for Brazil (HSB), AIRS constitutes an innovative
  atmospheric sounding group of visible,  infrared, and microwave sensors. AIRS data
  will be generated continuously. Global coverage will be obtained twice daily (day
  and night) on a 1:30pm sun synchronous orbit from a 705-km altitude.n                                          nThe
  AIRS Standard Retrieval Product consists of retrieved estimates of  cloud and surface
  properties, plus profiles of retrieved temperature,  water vapor, ozone, carbon
  monoxide and methane. Estimates of the errors associated with these quantities will
  also be part of the Standard Product. The temperature profile vertical resolution
  is 28 levels total between 1100 mb and 0.1 mb, while moisture profile is reported
  at 14 atmospheric layers between 1100 mb and 50 mb. The horizontal resolution is
  50 km. An AIRS granule has been set as 6 minutes of data, 30 footprints cross track
  by 45 lines along track.n                                          n(The Shortname
  for this product is AIRX2RET_NRT).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
